    class Day5
    {


        private string path = "../../Input/input5.txt";
        //using raw because
        private string raw = "";

        //bool parsed = false;
        List<char> input = new List<char>();
        //int interactions = 0;

        public void ParseInput(string path)
        {
            //if (parsed)
            //    return;

            //StreamReader reader = new StreamReader(path);

            //input = reader.ReadToEnd().ToList();
            input = raw.ToCharArray().ToList();
            //Console.WriteLine("First: " + input[0] + " Last: " + input[input.Count - 1]);

            //reader.Close();

            //parsed = true;
        }

        public void GetAnswer()
        {
            ParseInput(path);

            Console.WriteLine("Answer A: " + CalculateReactions(input));

            int shortestChain = input.Count;

            for (int i = 65; i < 91; i++)
            {
                string upper = char.ConvertFromUtf32(i);
                string lower = char.ConvertFromUtf32(i + 32);

                //Console.WriteLine(upper + " " + lower);
                //List<char> modInput = input;
                string modRaw = raw;
                modRaw = modRaw.Replace(upper, "").Replace(lower, "");

                int chainLength = CalculateReactions(modRaw.ToCharArray().ToList());
                if (chainLength < shortestChain)
                    shortestChain = chainLength;
                //modInput = modInput.RemoveAll();
            }
            Console.WriteLine("Answer B : " + shortestChain);
        }

        private int CalculateReactions(List<char> chain)
        {
            bool done = false;

            do
            {
                done = true;
                //65 = A, 65 + 32 = a (loop through all letters

                int smallestChain = chain.Count;

                for (int i = 0; i < chain.Count - 1; i++)
                {

                    if ((char.IsLower(chain[i]) && char.IsUpper(chain[i + 1])) ||
                        char.IsUpper(chain[i]) && char.IsLower(chain[i + 1]))
                    {
                        if (char.ToLower(chain[i]) == char.ToLower(chain[i + 1]))
                        {
                            //Console.WriteLine("Removed: " + nextChar + " and " + input[i]);
                            chain.RemoveRange(i, 2);
                            done = false;
                        }
                    }
                    //Console.WriteLine(nextChar);
                }

                //Console.WriteLine(input.Count + " last count:" + lastLen);
            }
            while (!done);

            return (chain.Count);
        }

    }
